import React, { useState, useEffect } from "react";
import axios from "axios";

let Summary = () => {
  let [data, setData] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:3000")
      .then((res) => {
        setData(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <>
      <table border={2}>
        <thead>
          <tr>
            <th>H.no</th>
            <th>Name</th>
            <th>Maths</th>
            <th>Physics</th>
            <th>Chemistry</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item._id}>
              <td>{item._id}</td>
              <td>{item.name}</td>
              <td>{item.maths}</td>
              <td>{item.physics}</td>
              <td>{item.chemistry}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </>
  );
};

export default Summary;
